	public String generateProductName(int type) {
		switch(type) {
			case 1: {
				return ROBOT_NAMES[(int )Math.floor(Math.random()*ROBOT_NAMES.length)];
			}
			case 2: {
				return MONSTER_NAMES[(int )Math.floor(Math.random()*MONSTER_NAMES.length)];
			}
			case 3: {
				return (CAT_NAMES[(int )Math.floor(Math.random()*CAT_NAMES.length)]+" "+ROBOT_NAMES[(int )Math.floor(Math.random()*ROBOT_NAMES.length)]);
			}
			case 4: {
				return CAT_NAMES[(int )Math.floor(Math.random()*CAT_NAMES.length)];
			}
			default: {
				return ROBOT_NAMES[(int )Math.floor(Math.random()*ROBOT_NAMES.length)];
			}
		}
	}
	
	public LocalDateTime generateDate() {
		ZoneId zoneId = ZoneId.systemDefault();
	    long minSec = LocalDateTime.of(1970, 1, 1, 1, 1).atZone(zoneId).toEpochSecond();
	    long maxSec = LocalDateTime.of(2015, 12, 31, 1, 1).atZone(zoneId).toEpochSecond();
	    long randomSecond = ThreadLocalRandom.current().nextLong(minSec, maxSec);
	    LocalDateTime randomDate = LocalDateTime.ofInstant(Instant.ofEpochSecond(randomSecond), zoneId);
	    return randomDate;
	}
	
	public String generateDescription() {
		return DESCRIPTIONS[(int )Math.floor(Math.random()*DESCRIPTIONS.length)];
	}
	
	
	
